    constructor(x, y, z) {
        this.type = 'Point';
        this.z = 0;
        if (Array.isArray(x)) {
            if (x.length >= 2) {
                this.x = x[0] || 0;
                this.y = x[1] || 0;
            }

            if (x.length == 3) {
                this.z = x[2];
            }
        } else if (x != null && typeof x == 'object') {
            this.x = x.x || 0;
            this.y = x.y || 0;
            this.z = x.z || 0;
        } else {
            this.x = x || 0;
            this.y = y || 0;
            this.z = z || 0;
        }
    }

    /**
