        const p = result || this;
        p.x = this.x / k;
        p.y = this.y / k;
        p.z = this.z / k;
        return p;
    }

    dot(p) {
        return this.x * p.x + this.y * p.y + this.z * p.z;
    }

    cross(v) {

        return this.x * v.y - this.y * v.x;

    }

    unit() {
        return this.clone()._unit();
    }

    _unit() {
        this._divScalar(this.mag());
        return this;
    }

    mag() {
        return Math.sqrt(this.magSqured());
    }

    magSqured() {
        return this.x * this.x + this.y * this.y + this.z * this.z;
    }

    _perp() {
        const y = this.y;
        this.y = this.x;
        this.x = -y;
        return this;
    }

    /**
